import React, { useState } from 'react';

const data = [
  {
    traderMandateId: 567,
    traderComitId: null,
    traderName: null,
    // ... other fields ...
    newLocation: "PUNE",
    oldLocation: "Chennai",
    // ... other fields ...
  },
  {
    traderMandateId: 568,
    traderComitId: null,
    traderName: null,
    // ... other fields ...
    newLocation: "PUNE",
    oldLocation: "Chennai",
    // ... other fields ...
  }
];

function App() {
  const [selectedTrader, setSelectedTrader] = useState(null);

  const handleButtonClick = (trader) => {
    setSelectedTrader(trader);
  };

  return (
    <div className="App">
      {data.map((trader, index) => (
        <button key={index} onClick={() => handleButtonClick(trader)}>
          Show Trader {trader.traderMandateId}
        </button>
      ))}

      {selectedTrader && (
        <div>
          <p>Trader Mandate ID: {selectedTrader.traderMandateId}</p>
          <p>Trader Name: {selectedTrader.traderName || "N/A"}</p>
        </div>
      )}
    </div>
  );
}

export default App;
